import React from 'react';

const SortDropdown = (props) => {
    console.log(e.target.name)
    return (
        <select className="sortDropdown" onChange={e => props.sortChange(e)}>
            <option value='total' name='📃'>📃 Total</option>
            <option value='nightlife' name='🍻'>🍻 Nightlife</option>
            <option value='happiness' name='😁'>😁 Happiness</option>
            <option value='internet' name='🌎'>🌎 Internet </option>
        </select>
    )
}

export default SortDropdown;
